(function (jsPDFAPI) {
  const font = '';
  const callAddFont = function () {
    this.addFileToVFS('ITCAvantGardePro-Bk-normal.ttf', font);
    this.addFont('ITCAvantGardePro-Bk-normal.ttf', 'ITCAvantGardePro-Bk', 'normal');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
  /* eslint-disable no-undef */
}(jsPDF.API));
